DROP TABLE country;
CREATE TABLE country(
	country_id SERIAL NOT NULL,
	iso_code VARCHAR(3) NOT NULL,
	country_name VARCHAR(100) NOT NULL,
	nationality_name VARCHAR(100) NULL,
	phone_code VARCHAR(4) NULL,
	risk int NOT NULL DEFAULT 0,
	change_nid int NOT NULL DEFAULT 0,
	app_usernid int NULL,
	app_ip_address varchar(15) NULL,
	app_computer_name VARCHAR(30) NULL,
	sys_userid VARCHAR(30) NULL,
	sys_terminalid VARCHAR(30) NULL,
	last_update TIMESTAMPTZ NOT NULL DEFAULT with_timezone(),
	auto_date TIMESTAMPTZ NOT NULL DEFAULT with_timezone(),
 CONSTRAINT PK_Country PRIMARY KEY 
(
	country_id
)
);
